import React from 'react';
import {
  Avatar,
  Card,
  CardContent,
  CardHeader,
  Chip,
  Stack,
  Typography,
  List,
  ListItem,
  ListItemAvatar,
  ListItemText,
  Divider,
  TextField,
  Button,
} from '@mui/material';
import PersonIcon from '@mui/icons-material/Person';
import CheckCircleIcon from '@mui/icons-material/CheckCircle';
import CommentIcon from '@mui/icons-material/Comment';
import SendIcon from '@mui/icons-material/Send';

const UserStoryPage = () => {
  return (
    <Stack spacing={3} sx={{ padding: 3 }}>
      <Card>
        <CardHeader
          title="User Story Title"
          subheader="Assigned to: John Doe, Jane Smith"
          avatar={
            <Avatar sx={{ bgcolor: 'primary.main' }}>
              <PersonIcon />
            </Avatar>
          }
        />
        <CardContent>
          <Typography variant="h6" gutterBottom>
            Description
          </Typography>
          <Typography variant="body1" paragraph>
            This is a detailed description of the user story. It explains the goals, requirements, and acceptance criteria.
          </Typography>
          <Typography variant="h6" gutterBottom>
            Status
          </Typography>
          <Chip icon={<CheckCircleIcon />} label="In Progress" color="warning" />
        </CardContent>
      </Card>
      <Card>
        <CardHeader
          title="Comments"
          avatar={
            <Avatar sx={{ bgcolor: 'secondary.main' }}>
              <CommentIcon />
            </Avatar>
          }
        />
        <CardContent>
          <List>
            <ListItem alignItems="flex-start">
              <ListItemAvatar>
                <Avatar>J</Avatar>
              </ListItemAvatar>
              <ListItemText
                primary="John Doe"
                secondary={
                  <React.Fragment>
                    <Typography
                      sx={{ display: 'inline' }}
                      component="span"
                      variant="body2"
                      color="text.primary"
                    >
                      This is a comment from John Doe.
                    </Typography>
                    {" — I'll review the requirements and update the status soon."}
                  </React.Fragment>
                }
              />
            </ListItem>
            <Divider variant="inset" component="li" />
            <ListItem alignItems="flex-start">
              <ListItemAvatar>
                <Avatar>J</Avatar>
              </ListItemAvatar>
              <ListItemText
                primary="Jane Smith"
                secondary={
                  <React.Fragment>
                    <Typography
                      sx={{ display: 'inline' }}
                      component="span"
                      variant="body2"
                      color="text.primary"
                    >
                      Jane Smith
                    </Typography>
                    {" — I've completed the initial draft of the documentation."}
                  </React.Fragment>
                }
              />
            </ListItem>
          </List>
          <Stack direction="row" spacing={2} sx={{ mt: 2 }}>
            <TextField
              variant="outlined"
              fullWidth
              label="Add a comment"
              multiline
              rows={2}
            />
            <Button variant="contained" endIcon={<SendIcon />} sx={{ height: 'fit-content' }}>
              Send
            </Button>
          </Stack>
        </CardContent>
      </Card>
    </Stack>
  );
};

export default UserStoryPage;
